DELIMITER $$
--
-- Procedimientos
--
CREATE DEFINER=`root`@`localhost` PROCEDURE `ActualizarProfesor` (IN `p_Id_Profesor` INT, IN `p_Id_Imagen` INT, IN `p_Nombre` VARCHAR(30), IN `p_Apellido` VARCHAR(30), IN `p_Numero_Documento` INT(11), IN `p_Telefono` VARCHAR(11), IN `p_Fecha_Nacimiento` DATE, IN `p_Asignacion_Academica` VARCHAR(20), IN `p_Asignatura` VARCHAR(30), IN `p_Area` VARCHAR(30), IN `p_Email` VARCHAR(50), IN `p_Contrasena` VARCHAR(255))   BEGIN
    UPDATE profesor
    SET
    	Id_Imagen = p_Id_Imagen,
        Nombre = p_Nombre,
        Apellido = p_Apellido,
        Numero_Documento = p_Numero_Documento,
        Telefono = p_Telefono,
        Fecha_Nacimiento = p_Fecha_Nacimiento,
        Asignacion_Academica = p_Asignacion_Academica,
        Asignatura = p_Asignatura,
        Area = p_Area,
        Email = p_Email,
        Contrasena = p_Contrasena
    WHERE Id_Profesor = p_Id_Profesor;
END$$

